import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import HomePage from './components/HomePage'

function App() {
  return (
    <>
    <Navbar/>
    <Router>
          <Routes>
            <Route path="/" element={<HomePage/>} />
          </Routes>
        </Router>
    </>
  );
}

export default App;
